 order being made , understand English or they need not to work at a drive thru\"                                                         \n","[6] \"I work for door dash and they locked us all out to wait in a long line for no reason at . I tried to beg them to open it because I'm door dash and they refused.  Covid is over get a new job\"                                                                                                                                                                                   "]},"metadata":{},"output_type":"display_data"}],"source":["## Removing URLs and cleaning the data\n","McReviews$stripped_text <- gsub(\"http.*\",\"\",  McReviews$review)\n","McReviews$stripped_text <- gsub(\"https.*\",\"\", McReviews$review) \n","McReviews$stripped_text <- gsub(\"https:*\",\"\", McReviews$review)\n","McReviews$stripped_text <- gsub(\"amp\",\"\", McReviews$review)\n","McReviews$stripped_text <- gsub(\"RT\",\"\", McReviews$review)\n","McReviews$stripped_text <- stripWhitespace(McReviews$review)\n","McReviews$stripped_text <- removeNumbers(McReviews$review)\n","head(McReviews$stripped_text)"]},{"cell_type":"code","execution_count":4,"id":"6a71a760","metadata":{"execution":{"iopub.execute_input":"2023-12-26T15:24:47.155681Z","iopub.status.busy":"2023-12-26T15:24:47.153963Z","iopub.status.idle":"2023-12-26T15:24:48.116701Z","shell.execute_reply":"2023-12-26T15:24:48.1141Z"},"papermill":{"duration":0.98031,"end_time":"2023-12-26T15:24:48.119847","exception":false,"start_time":"2023-12-26T15:24:47.139537","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>store_address</th><th scope=col>reviewNumber</th><th scope=col>word</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>13749 US-183 Hwy, Austin, TX 78750, United States</td><t