t Scores for McDonald's Store Locations (US)\",\n","       x = \"Location Code\",  # Modify x-axis label\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n"]},{"cell_type":"markdown","id":"9f6de450","metadata":{"_cell_guid":"5b2b4a04-2818-4fc8-ad20-b195b84734a0","_uuid":"6f3f1627-486b-4253-b00f-e70a479511ae","papermill":{"duration":0.025805,"end_time":"2023-12-26T15:24:54.683026","exception":false,"start_time":"2023-12-26T15:24:54.657221","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"aafb60b8","metadata":{"papermill":{"duration":0.025249,"end_time":"2023-12-26T15:24:54.734049","exception":false,"start_time":"2023-12-26T15:24:54.7088","status":"completed"},"tags":[]},"source":["**Conclusion**\n","* The customers are actively speaking on the McDonald's experience as per the word cloud.\n","* The overall sentiment analysis provides a slightly positive sentiment score of 0.058.\n","* Client reviews for store 10 (1415 E State Rd, Fern Park) shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores."]},{"cell_type":"markdown","id":"b76c39ef","metadata":{"papermill":{"duration":0.025483,"end_time":"2023-12-26T15:24:54.78454","exception":false,"start_time":"2023-12-26T15:24:54.759057","status":"completed"},"tags":[]},"source":["**References**\n","\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3422393,"sourceId":5968827,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_